    value: 'Line 19 includes some anonymous contributions.  No single anonymous contribution
      was more than $20.  Line 21 includes payments to some employees for payroll.  These
      employees spent less than 25% of their time on federal election activity and
      therefore their payroll expenses are allocable.  Line 21 includes a Transfer
      of $19,600 from the Republican National Committee.  These funds were used in
      accordance with 11 CFR and not used for Federal Election Activity.    In response
      to your request for more information dated May 5, 2010 regarding the April Monthly
      report covering 3/1/10-3/31/10 I have the following responses.  1.  $3,244.45
      offset from operating expenditures from Friends of Roy Blunt.  Missouri Republican
      State Committee charges Friends of Roy Blunt the normal and usual charge for
      rent of office space.  This payment is for that rent.  2.  The allocated activity
      and event year-to date total calculations.  The year-to-date totals were corrected
      with a previous amendment of the March Monthly report.  3.Best Efforts.  For
      the 2009-2010 reporting period, the Missouri Republican State Committee followed
      and continues to follow a best efforts policy to obtain identification for contributors:         1.  All
      original solicitations include a clear and conspicuous request for the contributor
      information and inform contributors that federal law requires committees to
      use their best efforts to obtain such information.         2.  If information
      is not provided, a written request is sent, within 30 days of the contribution
      receipt, clearly asking for the missing information without soliciting a contribution,
      informing the contributor of the requirements of federal law for the reporting
      of such information, and including a pre-addressed post card or return envelope.  4.  Event
      expenses.  Expenditures made for event programs, event rental and food and event
      rental and lodging are expenditures made for Missouri Republican State Committee
      events only.  The expenditures were not made on behalf of specifically identified
      federal candidates.'
